import Rebase from 're-base';
import firebase from 'firebase';

const firebaseApp = firebase.initializeApp({
  apiKey: "AIzaSyDdjCjtT46BvMEaVpnHLa_V34IjJfPtJnA",
  authDomain: "burgers-5cc11.firebaseapp.com",
  databaseURL: "https://burgers-5cc11-default-rtdb.europe-west1.firebasedatabase.app"
})

const base = Rebase.createClass(firebaseApp.database());

export { firebaseApp };
export default base;
